import { useState } from "react";

const Form = ()=>{

    const [form, setForm] = useState({
        name:"",
        weight:"",
        height:"",
        life_span:"",
        temperament:[],
        image:""
    })

    const [weightH, setWeightH] = useState({
        min:"",
        max:""
    })

 const changeHandler = (event) => {
        const property = event.target.name;
        const value = event.target.value;
      
        setForm({ ...form, [property]: value });
      };
      
const weightHandler = (event) => {
        const property = event.target.name;
        const value = event.target.value;
        
        switch (property) {
            case "min":
              setWeightH({ ...weightH, min: value});
            case "max":
              setWeightH({ ...weightH, max: value});
            default:
              return { ...state };
          }

    const final = [weightH.min, weightH.max].join("")

    setForm({ ...form, weight: final });
      };
      
const heightHandler = (event) => {
    
    const property = event.target.name;
    const value = event.target.value;

    const min = [];
    const max = ["-"];
    
    if(property === "min"){
        min.push(value)
    }

    if(property === "max"){
        max.push(value)
    }

    const final=min.concat(max).join(" ")

    setForm({ ...form, height: final });
};
      
const handleSubmit = (event) => {
        event.preventDefault(); //! Asi no recarga la pag cuando tocamos enter
      };
      
   
    return(
        <form>
            <h2>
                Create a new dog
            </h2>

            <div>
                <label></label>
                <input 
                type="text"
                placeholder="Name" 
                value={form.name} 
                onChange={changeHandler} 
                name="name">
                </input>         
            </div>

            <div>
                <label></label>
                <input 
                type="text" 
                placeholder="Weight Min" 
                onChange={weightHandler}
                name="min">
                </input>  
                <> a </>
                <input 
                type="text" 
                placeholder="Weight Max"
                onChange={weightHandler}
                name="max" >
                </input>  
                <> Kg </>     
            </div>

            <div>
                <label></label>
                <input 
                type="text" 
                placeholder="Height Min"
                name="min" 
                onChange={heightHandler}>
                </input> 
                <> a </>
                <input 
                type="text" 
                placeholder="Height Max"
                name="max" 
                onChange={heightHandler} >
                </input>   
                <> Cm </>        
            </div>

            <div>
                <label></label>
                <input 
                type="text" 
                placeholder="Life expectancy" 
                value={form.life_span} 
                onChange={changeHandler} 
                name="life_span">
                </input>
                <> Years </>          
            </div>

            
            <div>
                <label></label>
                <input 
                type="text" 
                placeholder="Temperaments" >
                </input>         
            </div>

            <div>
                <label>Ingrese URL o suba su imagen</label>
                <input 
                type="text" 
                value={form.image}>
                </input>
                <> </>
                <input 
                type="file" 
                value={form.image}>
                </input>         
            </div>

            <div>
                <label></label>
                <input 
                type="submit" 
                onSubmit={handleSubmit}>
                </input>         
            </div>
        </form>
    )
}

export default Form;
